import React from "react";
import "./App.css"
const Btn =()=>{
    let date = new Date(); 
    let hh = date.getHours();
    let mm = date.getMinutes(); 
    let ss = date.getSeconds();
    let time = <>{hh}:{mm}:{ss}</>
    return (time)
}
const App = () => {
    
    return (
        <>
        <div className="container">
           <div className="time"> <h1>{time}</h1> </div>
           <button className="btn" onClick={Btn}>get time!</button>
        </div>
       
        </>
    )
}
export default App
